DROP TABLE IF EXISTS `mensajes`;
CREATE TABLE `mensajes`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fecha` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0),
  `msg` text CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `tipo` int(11) NULL DEFAULT 1,
  `usuario` int(11) NOT NULL,
  `destino` int(11) NOT NULL,
  `visible` int(1) NOT NULL DEFAULT 1,
  `leido` int(1) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `usuario_destino`(`destino`) USING BTREE,
  INDEX `tipo_mensaje`(`tipo`) USING BTREE,
  INDEX `usuario_dest`(`usuario`) USING BTREE,
  CONSTRAINT `tipo_mensaje` FOREIGN KEY (`tipo`) REFERENCES `tipo de mensaje` (`value`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `usuario_dest` FOREIGN KEY (`usuario`) REFERENCES `usuarios` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `usuario_origen` FOREIGN KEY (`usuario`) REFERENCES `usuarios` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 61 CHARACTER SET = utf8 COLLATE = utf8_spanish_ci ROW_FORMAT = Dynamic;

